import {
  STUDENT_SUCCESS
} from '../actions/student';

export default function reducer(statePart = [], action = {}) {
  switch (action.type) {
    case STUDENT_SUCCESS:
      return {
        ...statePart,
        data: action.payload,
        isFetching: false
      }
    default:
      return statePart;
  }
}
